import React from 'react';

export default function Footer() {
    return (
        <div className="footer">
            <div className="credits">
                Photo from <a href="https://unsplash.com/es/@fakurian?utm_content=creditCopyText&utm_medium=referral&utm_source=unsplash" target="_blank" rel="noreferrer">Milad Fakurian</a> on <a href="https://unsplash.com/es/fotos/globos-amarillos-y-blancos-sobre-superficie-naranja-PGdW_bHDbpI?utm_content=creditCopyText&utm_medium=referral&utm_source=unsplash" target="_blank">Unsplash</a>
            </div>
            <div className="copyright">
                &copy; Copyright 2024 Carlos Barraza
            </div>
        </div>
    );
}
